import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Schedule = () => (
  <View style={styles.container}>
    <Text style={styles.day}>Monday</Text> 


    <View style={styles.tableRow}>
      <Text style={[styles.tableCell, styles.headerCell]}>Section</Text>
      <Text style={[styles.tableCell, styles.headerCell]}>Time</Text>
      <Text style={[styles.tableCell, styles.headerCell]}>Subject</Text>
    </View>


    <View style={[styles.tableRow, styles.tableRowOdd]}> 
      <Text style={styles.tableCell}>Section 1</Text>
      <Text style={styles.tableCell}>8:00 AM - 9:30 AM</Text>
      <Text style={styles.tableCell}>ITE329</Text>
    </View>

    <View style={styles.tableRow}>
      <Text style={styles.tableCell}>Section 2</Text>
      <Text style={styles.tableCell}>10:00 AM - 11:30 AM</Text>
      <Text style={styles.tableCell}>ITE301</Text>
    </View>

    <View style={[styles.tableRow, styles.tableRowOdd]}> 
      <Text style={styles.tableCell}>Section 3</Text>
      <Text style={styles.tableCell}>11:00 AM - 12:30 AM</Text>
      <Text style={styles.tableCell}>ITE304</Text>
    </View>

    <View style={styles.tableRow}>
      <Text style={styles.tableCell}>Section 4</Text>
      <Text style={styles.tableCell}>1:00 PM - 2:30 PM</Text>
      <Text style={styles.tableCell}>ITE305</Text>
    </View>

    {/* Add more rows as needed */}
  </View>
);

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    backgroundColor: 'white',
  },
  tableRow: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    borderBottomWidth: 1,
    borderBottomColor: 'lighgray',
    paddingVertical: 10,
  },
  tableRowOdd: {
    backgroundColor: 'lightblue', 
  },
  tableCell: {
    flex: 1,
    fontSize: 16,
    paddingHorizontal: 5,
  },
  headerCell: {
    fontWeight: 'bold',
  },
  day: {
    fontSize: 20,
    fontWeight: 'bold',
    marginBottom: 10,
  },
});

export default Schedule;
